' --gauge min',
' ''gaugeMin'' VALUE NULL,',
' --gauge max',
' ''gaugeMax'' VALUE NULL,',
' --type (single,multi)',
' ''gaugeType'' VALUE ''single'',',
' --full circle [1,0]',
